import React from "react";
import { BsList, BsFillCaretDownFill } from "react-icons/bs";
import { FaSearch, FaUser } from "react-icons/fa";
import "./header.scss";
import react,{useState,useEffect} from "react";

const Header = () => {
 const [open,setOpen]=useState(false)
const handleOnclick = ()=>{
  setOpen(!open)
}
  return (
    <section>
      <div className="c-header">
        <div className="c-header__col1">
          <h1 className="c-header__headertitle">Quản Lý Bán Hàng</h1>
          <BsList className="c-header__icon"/>
        </div>
        <div className="c-header__col2">
          <h1 style={{color:'white'}}>Admin</h1>
          <div >
            <FaUser  className="c-header__icon"/>
            <BsFillCaretDownFill  className="c-header__icon" onClick={handleOnclick}/>
          </div>
          <div className="c-header__auth">
          <h1>Login</h1>
          <hr width="100%" align="center"></hr>
          <h1>Register</h1>
         </div>
        </div>
        
      </div>
    </section>
  );
};

export default Header;
